import React, { Component } from "react";
import "./App.css";
import TextField from "@material-ui/core/TextField";

class Register extends Component {
  constructor(props) {
    super(props);
    this.state = {
      first_name: "",
      last_name: "",
      email: "",
      password: ""
    };
  }

  render() {
    return (
      <div>
        <div>
          <TextField
            id="standard-name"
            label="Name"
            className="Test"
            margin="normal"
          />
        </div>
      </div>
    );
  }
}

export default Register;
